import React from 'react';
import Card from './card';
import './card_sugges.css';
import SuggestionCard from './card_sugges_json';



class CardSuggestion extends React.Component{
  render(){
    return(
      <div>
      <div className="col-12 othser">
        <div className="vl"></div>
        <h2 className="font-weight-bold">Other services</h2>
        <h6>Suggestions</h6>
      </div>
      {SuggestionCard.map((item,index)=>{
        return(
          <div key={index} className="card-deck pt-5 col-12">
            <div className="card cardcard">
              <center><img className="imgcard card-img-top img-fluid" src={item.card1.url}/></center>
              <div className="card-body cardtext">
                <h6  className="card-title"><b>{item.card1.title}</b></h6>
                <p className="card-text">{item.card1.text}</p>
                <p className="card-text">{item.card1.text2}</p>
                <p className="card-text">{item.card1.text3}</p>
                <p className="card-text">{item.card1.text4}<a href="#">{item.card1.link}</a></p>
              </div>
            </div>
            <div className="card cardcard">
              <center><img className="imgcard card-img-top img-fluid" src={item.card2.url}/></center>
              <div className="card-body cardtext">
                <h6  className="card-title"><u><b>{item.card2.title}</b></u></h6>
                <p className="card-text"><a href="#"><b><u>{item.card2.text}</u></b></a></p>
                <p className="card-text">
                {item.card2.text2}
                </p>
              </div>
           </div>
           <div className="card cardcard">
             <center><img className="imgcard card-img-top img-fluid" src={item.url}/></center>
             <div className="card-body cardtext">
               <h6 className="card-title"><b>{item.title}</b></h6>
               <p className="card-text">
                {item.text}
               </p>
                <p className="card-text">
                  <a href="#"><b><u>{item.link}</u></b></a> {item.text2}
               </p>
             </div>
          </div>
        </div>

        )})}

  </div>
  )}}
export default CardSuggestion
